import styles from "../topView.module.css";  // CSS モジュールを適用

const Header = () => {
  return (
    <header className={styles.header}>
      <div className={styles.leftSection}>
        <h1 className={styles.logo}>案件管理システム</h1>
        <button className={styles.detailButton} onClick={() => navigate("/projects")}>
          案件詳細
        </button>
      </div>
    </header>
  );
};

export default Header;
